import React from 'react';
import './ElegantDivider.css';

const ElegantDivider = ({ type = 'minimal' }) => {
    switch (type) {
        case 'gradient':
            return <div className="divider-gradient"></div>;

        case 'diagonal':
            return <div className="divider-diagonal"></div>;

        case 'dot':
            return (
                <div className="divider-dot">
                    <div className="divider-dot-element"></div>
                </div>
            );

        case 'fade':
            return (
                <div className="divider-fade">
                    <div className="divider-fade-line"></div>
                </div>
            );

        case 'minimal':
        default:
            return <div className="divider-minimal"></div>;
    }
};

export default ElegantDivider;
